import React from 'react';
import {Helmet} from "react-helmet";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    // Redirect,
} from "react-router-dom";

import Home from './app/Home/Home';
import LandingPage from './app/Login/LandingPage';


function App() {
    
    return (
        <>
        <Helmet>
            <script src="/assets/carousel/js/script.js" type="text/javascript" />
        </Helmet>

        <Router>
            <Switch>
                <Route path="/home">
                    <Home />
                </Route>
                
                <Route path="/">
                    <LandingPage />
                </Route>
            
            </Switch>

        </Router>
        </>
    );
}

export default App;
